import React from 'react';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import BackgroundVideo from './components/BackgroundVideo';


import './App.css';

function App() {
  return (
    <div>
      <Navbar />
      <Summary />
      <OurValues />
      <Gallery />
      <TwoCards />
      <WhyUs />
      <EsteemedClients />
      <ContactUs />
      <Footer />
    </div>
  );
}

export default App;
